INSERT INTO `job_application_answer` VALUES (0000000009,0000000003,''),(0000000009,0000000005,'I\'m interested'),(0000000009,0000000012,''),(0000000009,0000000015,''),(0000000009,0000000016,''),(0000000009,0000000018,'ggkjg'),(0000000009,0000000022,'fjkdsafjklasd; jfkdsjafksdla jk fdjklfda fjkl; fadjkl;fdja fduio fdsauioualdlldkdkfl jdsa'),(0000000009,0000000024,''),(0000000010,0000000003,''),(0000000011,0000000005,'I\'ve worked on administrative projects before, and I believe my experience in the private sector would translate well to the public service.'),(0000000011,0000000008,'dsfsdfsdfsdf'),(0000000011,0000000009,''),(0000000011,0000000012,''),(0000000011,0000000015,''),(0000000011,0000000016,''),(0000000011,0000000018,'kgkgk'),(0000000011,0000000022,'Memes and Stickers'),(0000000011,0000000024,''),(0000000013,0000000004,''),(0000000013,0000000006,''),(0000000013,0000000007,''),(0000000013,0000000011,''),(0000000013,0000000013,'Test1'),(0000000013,0000000017,''),(0000000013,0000000019,'The term experimentation in the public policy context can sometimes have a negative connotation – bringing to mind everything from uncertainty and risk to failed social experiments. But experimentation shouldn’t be seen as something scary that should happen behind closed doors! Experimentation to me is all about continuous learning, adopting a growth mindset and about being fearless with sharing results - no matter what the intended outcome. You have to be willing to wear failure and recognize that it\'s part of the process. Having the opportunity to work with a team that is responsible for promoting experimentation in government is directly in line with my passion and future learning goals. In fact, I recently completed an EdEx course on Experimentation that focused on the deliberate use of methods that seek to explore, test and compare the effects and impacts of policies, interventions and approaches, in order to inform and support decision-making. My final project focused on learning what works and what doesn’t, and integrating the acquired knowledge into policy- and decision-making processes to arrive at the best outcomes for citizens. \n'),(0000000013,0000000021,''),(0000000014,0000000004,''),(0000000014,0000000006,''),(0000000014,0000000007,''),(0000000014,0000000011,''),(0000000014,0000000013,'Reasons'),(0000000014,0000000017,''),(0000000014,0000000019,'I am curious by nature. more info to come later...'),(0000000014,0000000021,'');
/*!40000 ALTER TABLE `job_application_answer` ENABLE KEYS */;
UNLOCK TABLES;

