INSERT INTO `job_poster_details` VALUES (0000000007,0000000004,0000000001,'','','Ottawa','Administrative Project Officer','Our team is small, but we serve a large community of 20,000 people in Government working in information management/information technologies (IM/IT). Our team helps coordinate priorities and activities across this community, including the recruitment of new talent, which is critical to the IM/IT community’s ability to deliver services to Canadians. \n\nIn your role as our team’s Administrative Project Officer, you’ll be helping to recruit new talent into the IM/IT community in Government of Canada. You’ll be working with our team to help select and assess potential candidates (e.g., group interviews). You’ll also be coordinating logistics for assessments (including in the regions) and career fair events to help match assessed candidates with hiring managers from across the Government of Canada. This work will help ensure the IM/IT community has the talent it needs to support a wide range of Government priorities.','CIOB','Talent Cloud'),(0000000008,0000000004,0000000002,'','','Ottawa','Agent de projet administratif','Nous avons une petite équipe, mais nous desservons une grande collectivité de 20 000 personnes au gouvernement dans le domaine de la gestion de l’information et de la technologie de l’information (GI-TI). Notre équipe aide à coordonner les priorités et les activités au sein de cette collectivité, y compris le recrutement de nouveaux talents, qui est essentiel à la capacité de la GI-TI d’offrir des services aux Canadiens.\n\nDans votre rôle d’agent de projet administratif de notre équipe, vous aiderez à recruter de nouveaux talents dans la collectivité de la GI-TI au gouvernement du Canada. Vous serez en collaboration avec notre équipe pour aider à sélectionner et à évaluer les candidats potentiels (par exemple, entrevues de groupe). En outre, vous assurerez la coordination de la logistique aux fins d’évaluation (y compris dans les régions) et des activités de la foire de carrière pour faciliter le jumelage des candidats évalués avec les gestionnaires responsables de l’embauche de partout au gouvernement du Canada. Ce travail aidera à garantir que la GI-TI a le talent nécessaire pour soutenir un large éventail de priorités du gouvernement.','DDPI','Nuage de talents'),(0000000011,0000000006,0000000001,'','','Ottawa','Administrative Project Officer','Our team is small, but we serve a large community of 20,000 people in Government working in information management/information technologies (IM/IT). Our team helps coordinate priorities and activities across this community, including the recruitment of new talent, which is critical to the IM/IT community’s ability to deliver services to Canadians. \n\nIn your role as our team’s Administrative Project Officer, you’ll be helping to recruit new talent into the IM/IT community in Government of Canada. You’ll be working with our team to help select and assess potential candidates (e.g., group interviews). You’ll also be coordinating logistics for assessments (including in the regions) and career fair events to help match assessed candidates with hiring managers from across the Government of Canada. This work will help ensure the IM/IT community has the talent it needs to support a wide range of Government priorities.','CIOB','Talent Cloud'),(0000000012,0000000006,0000000002,'','','Ottawa','','Nous avons une petite équipe, mais nous desservons une grande collectivité de 20 000 personnes au gouvernement dans le domaine de la gestion de l’information et de la technologie de l’information (GI-TI). Notre équipe aide à coordonner les priorités et les activités au sein de cette collectivité, y compris le recrutement de nouveaux talents, qui est essentiel à la capacité de la GI-TI d’offrir des services aux Canadiens.\n\nDans votre rôle d’agent de projet administratif de notre équipe, vous aiderez à recruter de nouveaux talents dans la collectivité de la GI-TI au gouvernement du Canada. Vous serez en collaboration avec notre équipe pour aider à sélectionner et à évaluer les candidats potentiels (par exemple, entrevues de groupe). En outre, vous assurerez la coordination de la logistique aux fins d’évaluation (y compris dans les régions) et des activités de la foire de carrière pour faciliter le jumelage des candidats évalués avec les gestionnaires responsables de l’embauche de partout au gouvernement du Canada. Ce travail aidera à garantir que la GI-TI a le talent nécessaire pour soutenir un large éventail de priorités du gouvernement.','DDPI','Nuage de talents'),(0000000013,0000000007,0000000001,'','','Ottawa','Junior Policy Outreach Support','Our team supports attempts at experimentation across the Government of Canada. What do we mean by experimentation? It’s really about evidence, and making decisions that are supported by evidence. Too often we think all decisions we take are based on well supported, well-reasoned data, research and evidence. Unfortunately, because of complexity, timing, etc., this is getting more and more difficult to do, especially considering financial constraints, the need to be very responsive, and always putting as many people first as possible (with diverse and often conflicting priorities). So that’s what you’d be supporting. You won’t work directly with Canadians, but you’ll enable departments to experiment with various interventions to know what works.',' Information Management and Technology Directorate','Business Applications Portfolio Management'),(0000000014,0000000007,0000000002,'','','Ottawa','Agent subalterne de communication des politiques','Notre équipe appuie les tentatives d’expérimentation dans l’ensemble du gouvernement du Canada. Que voulons-nous dire par expérimentation? Il s’agit vraiment des éléments de preuve et de prendre des décisions qui sont étayées par des éléments de preuve. Trop souvent, nous croyons que toutes les décisions que nous prenons sont fondées sur des données, des recherches et des éléments de preuve bien étayés et bien réfléchis. Malheureusement, en raison de la complexité, de l’échéance, entre autres, c’est de plus en plus difficile de le faire, surtout compte tenu des contraintes financières, de la nécessité d’être très réceptif et de toujours mettre au premier plan autant de gens que possible (avec diverses priorités et souvent contradictoires). C’est cette valeur que vous appuierez. Vous ne travaillerez pas directement avec des Canadiens, mais vous permettrez aux ministères d’expérimenter diverses interventions pour savoir ce qui fonctionne.','Direction générale de la gestion d\'information et de la technologie',' Gestion du portefeuille d\'applications d\'entreprise'),(0000000015,0000000008,0000000001,'','','Toronto','Boot Polisher','fgdfg','CIOB','Talent Cloud'),(0000000016,0000000008,0000000002,'','','Toronto','Boot Polisher FR','dfgdfg','DDPI','Nuage de talents');
