INSERT INTO `job_poster_key_task` VALUES (0000000021,0000000004,0000000001,'Event coordination (e.g., career matching job fairs) between candidates and departmental hiring managers'),(0000000022,0000000004,0000000002,'Coordination des activités (par exemple, salons et foires à l’emploi et placement) entre les candidats et les gestionnaires d’embauche du Ministère.'),(0000000023,0000000004,0000000001,'Career Fairs logistics (e.g., University recruitment campaigns, including preparing promotional materials as handouts (e.g., 1-pagers, stickers, etc.), audio-visual equipment rental (including loading content and testing technical solutions), banners, travel arrangements (e.g., across Canada).'),(0000000024,0000000004,0000000002,'Logistique relative aux salons à l’emploi (par exemple, les campagnes de recrutement dans les universités), y compris la préparation du matériel publicitaire sous forme de documents (par exemple, document d’une seule page, autocollants, etc.), location du matériel audiovisuel (y compris le chargement du contenu et l’essai des solutions techniques), des bannières, des préparatifs de voyage (par exemple, partout au Canada).'),(0000000025,0000000004,0000000001,'Team meeting coordination – boardroom bookings, calendar invites, distribution list creation, outreach to participants.'),(0000000026,0000000004,0000000002,'Coordination des réunions d’équipe – réservations des salles de conférence, invitation par calendrier, création de la liste de distribution, sensibilisation des participants.'),(0000000033,0000000006,0000000001,'Event coordination (e.g., career matching job fairs) between candidates and departmental hiring managers'),(0000000034,0000000006,0000000001,'Career Fairs logistics (e.g., University recruitment campaigns, including preparing promotional materials as handouts (e.g., 1-pagers, stickers, etc.), audio-visual equipment rental (including loading content and testing technical solutions), banners, travel arrangements (e.g., across Canada).'),(0000000035,0000000006,0000000001,'Team meeting coordination – boardroom bookings, calendar invites, distribution list creation, outreach to participants.'),(0000000036,0000000006,0000000001,'Coordination of assessments for candidates (e.g., booking rooms, ensuring supplies and equipment is available and tested in advance, advising candidates, etc.)'),(0000000037,0000000006,0000000001,'Proofing documents (e.g., promotional materials, ensuring translation and QA review) and other general administrative/clerical work, as required, to support the Recruitment team and broader Community Management Office (CMO).'),(0000000038,0000000006,0000000002,'Coordination des activités (par exemple, salons et foires à l’emploi et placement) entre les candidats et les gestionnaires d’embauche du Ministère.'),(0000000039,0000000006,0000000002,'Logistique relative aux salons à l’emploi (par exemple, les campagnes de recrutement dans les universités), y compris la préparation du matériel publicitaire sous forme de documents (par exemple, document d’une seule page, autocollants, etc.), location du matériel audiovisuel (y compris le chargement du contenu et l’essai des solutions techniques), des bannières, des préparatifs de voyage (par exemple, partout au Canada).'),(0000000040,0000000006,0000000002,'Coordination des réunions d’équipe – réservations des salles de conférence, invitation par calendrier, création de la liste de distribution, sensibilisation des participants.'),(0000000041,0000000006,0000000002,'Coordination des évaluations des candidats (par exemple, la réservation des salles, s’assurer que les fournitures et l’équipement sont disponibles et mis à l’essai à l’avance, informer les candidats, etc.)'),(0000000042,0000000006,0000000002,'Relecture des documents (par exemple, matériel publicitaire, s’assurer de la traduction et de l’examen de l’assurance de la qualité) et d’autres travaux généraux d’administration ou de bureau, au besoin, pour appuyer l’équipe de recrutement et le bureau général de gestion des collectivités.'),(0000000043,0000000007,0000000001,'Your primary role would be to build our outreach strategy (under the guidance of senior analysts and team manager), and be our friendly face showcasing what we do. This will involve having a solid policy understanding of experimentation and its role in Government, as well as policy approaches for application to Government work.'),(0000000044,0000000007,0000000001,'Your secondary role would be to help us with email, social media and forums, interacting with departments and answering policy questions related to experimentation. We get a lot of questions from all kinds of parts of many different departments and agencies, and we need to respond to them all.'),(0000000045,0000000007,0000000002,'Your secondary role would be to help us with email, social media and forums, interacting with departments and answering policy questions related to experimentation. We get a lot of questions from all kinds of parts of many different departments and agencies, and we need to respond to them all.'),(0000000046,0000000007,0000000002,'Votre rôle secondaire serait de nous aider avec les courriels, les médias sociaux et les forums, d’interagir avec les ministères et de répondre à des questions de politique liées à l’expérimentation. Nous recevons beaucoup de questions de toutes sortes de la part de nombreux ministères et organismes différents et nous devons répondre à toutes ces questions.'),(0000000047,0000000008,0000000001,'dfgdfg'),(0000000048,0000000008,0000000002,'dfgdfgdf');
