INSERT INTO `job_poster_question` VALUES (0000000009,0000000006,0000000001,'Why are you interested in this job?','We want to know why you are interested in this job instead of other similar ones. This information will be used to help inform a decision to choose between fully qualified candidates at the end of the selection process.'),(0000000010,0000000006,0000000002,'Pourquoi êtes-vous intéressé par ce travail?','Nous voulons savoir pourquoi vous êtes intéressé par ce travail au lieu d\'autres similaires. Cette information servira à éclairer la décision de choisir entre des candidats pleinement qualifiés à la fin du processus de sélection.'),(0000000011,0000000006,0000000001,'Why are you the right person for this job?','Tell us what makes you unique. Why should you stand out from other candidates. This information will be used to help inform a decision to choose between fully qualified candidates at the end of the selection process.'),(0000000012,0000000006,0000000002,'Pourquoi êtes-vous la meilleure personne pour ce travail?','Dites-nous pourquoi vous êtes unique. Pourquoi devriez-vous vous démarquer des autres candidats? Cette information servira à éclairer la décision de choisir entre des candidats pleinement qualifiés à la fin du processus de sélection.'),(0000000013,0000000007,0000000001,'Why are you interested in this job?','We want to know why you are interested in this job instead of other similar ones. This information will be used to help inform a decision to choose between fully qualified candidates at the end of the selection process.'),(0000000014,0000000007,0000000001,'Why are you the right person for this job?','Tell us what makes you unique. Why should you stand out from other candidates. This information will be used to help inform a decision to choose between fully qualified candidates at the end of the selection process.'),(0000000015,0000000007,0000000002,'Pourquoi êtes-vous intéressé par ce travail?','Nous voulons savoir pourquoi vous êtes intéressé par ce travail au lieu d\'autres similaires. Cette information servira à éclairer la décision de choisir entre des candidats pleinement qualifiés à la fin du processus de sélection.'),(0000000016,0000000007,0000000002,'Pourquoi êtes-vous la meilleure personne pour ce travail?','Dites-nous pourquoi vous êtes unique. Pourquoi devriez-vous vous démarquer des autres candidats? Cette information servira à éclairer la décision de choisir entre des candidats pleinement qualifiés à la fin du processus de sélection.'),(0000000017,0000000008,0000000001,'gdfgdfg','dfgdfgdf'),(0000000018,0000000008,0000000002,'dfgdfg','dfgdfgdfg');
