y like learning on the job from people who inspire me. There\'s room for more traditional classroom experiences, but I can only enjoy them in small doses.'),(0000000033,0000000006,''),(0000000034,0000000001,'I began my professional career as a \"scientist who could program computers\", but rapidly got pulled into a web development role. From there, through my side-of-the-desk work, I built the skills I needed to move to the departmental innovation hub when it was created. From there I moved with the team into a central agency to tackle some sticky whole of government problems around staffing and HR.'),(0000000034,0000000002,''),(0000000034,0000000003,'I\'m a team player and bring everyone up around me. Some very kind teammates have thanked me in the past for my energetic and positive outlook. In general though, I tend to try and fill in gaps that I see and make sure everyone is getting along.'),(0000000034,0000000004,'I like to have some clear instruction and lots of guidance while learning something new. I tend to pick things up quick though, so I rapidly become quite independent.'),(0000000034,0000000005,'I really like learning on the job from people who inspire me. There\'s room for more traditional classroom experiences, but I can only enjoy them in small doses.'),(0000000034,0000000006,'I\'m pretty good about fitting in wherever I\'m needed, but I do appreciate having lots of folks nearby for the stimulus that comes when interacting with colleagues.'),(0000000035,0000000001,'I began my professional career as a \"scientist who could program computers\", but rapidly got pulled into a web development role. From there, through my side-of-the-desk work, I built the skills I needed to move to the departmental innovation hub when it was created. From there I moved with the team into a central agency to tackle some sticky whole of government problems around staffing and HR.'),(0000000035,0000000002,'I chose physics for university because I thought it would be a challenge. It was. Since then been learning completely new disciplines by essentially taking jobs that I was (at the time) under qualified for. This has been, overall, a much more fun way to learn though it can be rather uncomfortable at times.'),(0000000035,0000000003,'I\'m a team player and bring everyone up around me. Some very kind teammates have thanked me in the past for my energetic and positive outlook. In general though, I tend to try and fill in gaps that I see and make sure everyone is getting along.'),(0000000035,0000000004,'I like to have some clear instruction and lots of guidance while learning something new. I tend to pick things up quick though, so I rapidly become quite independent.'),(0000000035,0000000005,'I really like learning on the job from people who inspire me. There\'s room for more traditional classroom experiences, but I can only enjoy them in small doses.'),(0000000035,0000000006,'I\'m pretty good about fitting in wherever I\'m needed, but I do appreciate having lots of folks nearby for the stimulus that comes when interacting with colleagues.'),(0000000038,0000000001,''),(0000000038,0000000002,''),(0000000038,0000000003,''),(0000000038,0000000004,''),(0000000038,0000000005,''),(0000000038,0000000006,''),(0000000040,0000000001,'lorem ipsum..... My career journey.... jdfklajsdkfljasdk;lfjaiofjiadjvidosvnioa;efhhja\nhfjdfjwoeufioaweufjiosdafkclsdc'),(0000000040,0000000002,''),(0000000040,0000000003,''),(0000000040,0000000004,''),(0000000040,0000000005,''),(0000000040,0000000006,''),(0000000041,0000000001,'lorem ipsum..... My career journey.... jdfklajsdkfljasdk;lfjaiofjiadjvidosvnioa;efhhja\nhfjdfjwoeufioaweufjiosdafkclsdc'),(0000000041,0000000002,''),(0000000041,0000000003,'awesome MEMES!!! and stickers!!'),(0000000041,0000000004,''),(0000000041,0000000005,''),(0000000041,0000000006,''),(0000000042,0000000001,''),(0000000042,0000000002,''),(0000000042,0000000003,''),(0000000042,0000000004,''),(0000000042,0000000005,''),(0000000042,0000000006,''